import React from "react";
import styles from "./Main.module.css"
import Product from "../Product/Product";

const Main = (props) => {

    let AppleElements = props.apple.map(ae=><Product {...ae}/>)

    return <div className={styles.main}>
        <div>Apple</div>
        <div>
            {AppleElements}
        </div>

        <div>
            Xiaomi
        </div>
        <div>

        </div>

    </div>
}

export default Main;
